import React from "react";

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <nav>
        <span>Title</span>
        <span>V.O. Title</span>
        <span>Overview</span>
      </nav>

      </header>
      <main>
      Aquí el contenido de nuestra lista, esto sería la home
      </main>
    </div>
  );
}

export default App;
